import React, { useState } from 'react';
import {NavLink, useHistory} from 'react-router-dom'
import styled from 'styled-components'

const Navbar = () => {
const history =useHistory();
const logout=async(e)=>{
e.preventDefault();

    const logo = await fetch('/logout' , {
        method: 'GET'
    });
    if(logo.status === 200){
        alert('Successfully logged out')
    }
    if(logo.status === 400){
        alert('Please login to log out :)');
        history.push('/signin')
    }

}


  return(
    <Container>
    <MidCont>
        <img src="middle.png" alt="" />
    </MidCont>
    <RightSide>
        <div className="home">
            <NavLink exact activeClassName="active" to="/">
                Home
            </NavLink>
        </div>
        <div className="vote">
            <NavLink exact activeClassName="active" to="/vote">
                Vote
            </NavLink>
        </div>
        <div className="register">
            <NavLink exact activeClassName="active" to="/signup">
                Register
            </NavLink>
        </div>
        <div className="login">
            <NavLink exact activeClassName="active" to="/signin">
                Login
            </NavLink>
        </div>
        <div className="logout">
            <NavLink exact activeClassName="active" to="/signout" onClick={logout}>
                Logout
            </NavLink>
        </div>
    </RightSide>
</Container>
  );
};

export default Navbar;
